let Users = [
    {
    "GID" : "123456",
    "Password" : "123456"
    },
    {
    "GID" : "123457",
    "Password" : "123456"
    },
    {
    "GID" : "123458",
    "Password" : "123456"
    },
    {
    "GID" : "123459",
    "Password" : "123456"
    },
]

let pushed = [
    {
        "GID" : "111122",
        "PASSWORD" : "111122"
    }
]

Users.push(pushed)

export default Users
